import React, { useState } from "react";
import {
  AppBar,
  Toolbar,
  IconButton,
  Box,
  Avatar,
  Menu,
  MenuItem,
  Typography,
  useMediaQuery,
  Tooltip,
  Popover,
  Paper,
} from "@mui/material";
import { useTheme } from "@mui/material/styles";
import ShareIcon from "@mui/icons-material/IosShare";
import NotificationsIcon from "@mui/icons-material/Notifications";
import Brightness4Icon from "@mui/icons-material/Brightness4";
import Brightness7Icon from "@mui/icons-material/Brightness7";
import ArrowDropDownIcon from "@mui/icons-material/ArrowDropDown";
import logo from "../assets/logo.png";

const Header = () => {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down("sm"));
  const [darkMode, setDarkMode] = useState(false);
  const [menuAnchor, setMenuAnchor] = useState(null);
  const [avatarAnchor, setAvatarAnchor] = useState(null);

  const brandColor = "#511378"; // Customize this for your Nuru brand theme

  const handleShare = () => {
    if (navigator.share) {
      navigator.share({
        title: "Nairobi Chapel – Ngong Road",
        url: window.location.href,
      });
    } else {
      navigator.clipboard.writeText(window.location.href);
      alert("Link copied to clipboard!");
    }
  };

  const handleToggleTheme = () => setDarkMode((prev) => !prev);

  const openMenu = (e) => setMenuAnchor(e.currentTarget);
  const closeMenu = () => setMenuAnchor(null);

  const openAvatar = (e) => setAvatarAnchor(e.currentTarget);
  const closeAvatar = () => setAvatarAnchor(null);

  return (
    <AppBar
      position="fixed"
      elevation={0}
      sx={{
        zIndex: (theme) => theme.zIndex.drawer + 1,
        background: "transparent",
        backdropFilter: "blur(8px)",
        borderBottom: "1px solid #eee",
      }}
    >
      <Toolbar sx={{ justifyContent: "space-between" }}>
        {/* Left: Logo */}
        <Box display="flex" alignItems="center">
          <img src={logo} alt="Nairobi Chapel Logo" style={{ height: 40, marginRight: 12 }} />
        </Box>

        {/* Right: Actions */}
        <Box display="flex" alignItems="center">
          {isMobile ? (
            <>
              <Tooltip title="Options">
                <IconButton color="inherit" onClick={openMenu}>
                  <ArrowDropDownIcon />
                </IconButton>
              </Tooltip>
              <Menu anchorEl={menuAnchor} open={Boolean(menuAnchor)} onClose={closeMenu}>
                <MenuItem onClick={closeMenu}>
                  <NotificationsIcon sx={{ color: brandColor, mr: 1 }} /> Notifications
                </MenuItem>
                <MenuItem onClick={() => { handleShare(); closeMenu(); }}>
                  <ShareIcon sx={{ color: brandColor, mr: 1 }} /> Share
                </MenuItem>
                <MenuItem onClick={() => { handleToggleTheme(); closeMenu(); }}>
                  {darkMode ? <Brightness7Icon sx={{ color: brandColor, mr: 1 }} /> : <Brightness4Icon sx={{ color: brandColor, mr: 1 }} />} Theme
                </MenuItem>
              </Menu>
            </>
          ) : (
            <>
              <Tooltip title="Share">
                <IconButton onClick={handleShare}>
                  <ShareIcon sx={{ color: brandColor }} />
                </IconButton>
              </Tooltip>
              <Tooltip title="Notifications">
                <IconButton>
                  <NotificationsIcon sx={{ color: brandColor }} />
                </IconButton>
              </Tooltip>
              <Tooltip title="Toggle Theme">
                <IconButton onClick={handleToggleTheme}>
                  {darkMode ? <Brightness7Icon sx={{ color: brandColor }} /> : <Brightness4Icon sx={{ color: brandColor }} />}
                </IconButton>
              </Tooltip>
            </>
          )}

          {/* Avatar */}
          {/* <IconButton onClick={openAvatar}>
            <Avatar sx={{ bgcolor: "#777" }}>A</Avatar>
          </IconButton>
          <Popover
            open={Boolean(avatarAnchor)}
            anchorEl={avatarAnchor}
            onClose={closeAvatar}
            anchorOrigin={{ vertical: "bottom", horizontal: "right" }}
            transformOrigin={{ vertical: "top", horizontal: "right" }}
          >
            <Paper sx={{ p: 2, minWidth: 200 }}>
              <Typography variant="subtitle1" fontWeight="bold">
                Nairobi Chapel
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Ngong’ Road
              </Typography>
              {/* Future: add logout, settings, etc. 
            </Paper>
          </Popover> 
          </AppBar> */}
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
